import React from 'react';
import TabBar from './TabBar';
import { BrowserRouter as Router } from 'react-router-dom';

export default {
  title: 'UI/ex/TabBar',
  component: TabBar,
};

const Template = (args) => (
  <Router>
    <TabBar {...args} />
  </Router>
);

export const Default = Template.bind({});
Default.args = {
  tabs: [
    { label: 'Tab 1', to: '/tab1' },
    { label: 'Tab 2', to: '/tab2' },
    { label: 'Tab 3', to: '/tab3' },
  ],
};
